import React, { useEffect, useRef } from 'react';
import { View, Animated, Easing } from 'react-native';
import Svg, { Path, Defs, LinearGradient, Stop, Filter, FeGaussianBlur, FeColorMatrix, FeTurbulence, FeDisplacementMap, FeComposite, FeMorphology, FeFlood, FeMerge, FeMergeNode } from 'react-native-svg';

const OctahedronSvg = ({ width = 60, height = 60, style, ...props }) => {
  const pulseAnim = useRef(new Animated.Value(0)).current;
  const rotateAnim = useRef(new Animated.Value(0)).current;
  const glitchAnim = useRef(new Animated.Value(0)).current;

  useEffect(() => {
    // Enhanced pulse animation
    Animated.loop(
      Animated.sequence([
        Animated.timing(pulseAnim, {
          toValue: 1,
          duration: 2000,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: true,
        }),
        Animated.timing(pulseAnim, {
          toValue: 0,
          duration: 2000,
          easing: Easing.inOut(Easing.sine),
          useNativeDriver: true,
        })
      ])
    ).start();

    // Slower rotation
    Animated.loop(
      Animated.timing(rotateAnim, {
        toValue: 1,
        duration: 40000,
        easing: Easing.linear,
        useNativeDriver: true,
      })
    ).start();

    // Random glitch effect
    const triggerGlitch = () => {
      Animated.sequence([
        Animated.timing(glitchAnim, {
          toValue: 1,
          duration: 100,
          easing: Easing.linear,
          useNativeDriver: true,
        }),
        Animated.timing(glitchAnim, {
          toValue: 0,
          duration: 100,
          easing: Easing.linear,
          useNativeDriver: true,
        })
      ]).start(() => {
        setTimeout(triggerGlitch, Math.random() * 5000 + 2000);
      });
    };
    triggerGlitch();
  }, []);

  const rotate = rotateAnim.interpolate({
    inputRange: [0, 1],
    outputRange: ['0deg', '360deg']
  });

  return (
    <Animated.View style={[
      {
        width,
        height,
        transform: [{ rotate }]
      },
      style
    ]}>
      <Svg
        width="100%"
        height="100%"
        viewBox="0 0 492 467"
        preserveAspectRatio="xMidYMid meet"
        fill="none"
      >
        <Defs>
          {/* Enhanced cyber noise */}
          <Filter id="enhancedNoise" x="-50%" y="-50%" width="200%" height="200%">
            <FeTurbulence
              type="fractalNoise"
              baseFrequency="0.01"
              numOctaves="3"
              seed="2"
              stitchTiles="stitch"
            />
            <FeDisplacementMap in="SourceGraphic" scale="3" />
          </Filter>

          {/* Digital glitch effect */}
          <Filter id="glitch" x="-20%" y="-20%" width="140%" height="140%">
            <FeTurbulence baseFrequency="0.05" numOctaves="3" result="noise" />
            <FeDisplacementMap
              in="SourceGraphic"
              in2="noise"
              scale="5"
              xChannelSelector="R"
              yChannelSelector="G"
            />
          </Filter>

          {/* Enhanced holographic glow */}
          <Filter id="enhancedGlow" x="-50%" y="-50%" width="200%" height="200%">
            <FeGaussianBlur stdDeviation="3" result="blur" />
            <FeFlood floodColor="#F4E409" floodOpacity="0.3" result="color"/>
            <FeComposite operator="in" in="color" in2="blur" result="glow"/>
            <FeMerge>
              <FeMergeNode in="glow" />
              <FeMergeNode in="glow" />
              <FeMergeNode in="SourceGraphic" />
            </FeMerge>
          </Filter>

          {/* Futuristic edge effect */}
          <Filter id="edgeEffect">
            <FeMorphology operator="dilate" radius="1" result="thick"/>
            <FeFlood floodColor="#F4E409" floodOpacity="0.5"/>
            <FeComposite operator="in" in2="thick"/>
            <FeGaussianBlur stdDeviation="2"/>
            <FeComposite operator="over" in="SourceGraphic"/>
          </Filter>

          {/* Enhanced gradient for faces */}
          <LinearGradient id="enhancedFill" x1="0%" y1="0%" x2="100%" y2="100%">
            <Stop offset="0%" stopColor="#F4E409" stopOpacity="0.9" />
            <Stop offset="45%" stopColor="#F4E409" stopOpacity="0.5" />
            <Stop offset="55%" stopColor="#F4E409" stopOpacity="0.3" />
            <Stop offset="100%" stopColor="#F4E409" stopOpacity="0.1" />
          </LinearGradient>

          {/* Animated edge gradient */}
          <LinearGradient id="animatedEdge" x1="0%" y1="0%" x2="100%" y2="0%">
            <Stop offset="0%" stopColor="#F4E409" stopOpacity="1" />
            <Stop offset="50%" stopColor="#F4E409" stopOpacity="0.7" />
            <Stop offset="100%" stopColor="#F4E409" stopOpacity="1" />
          </LinearGradient>
        </Defs>

        {/* Background glow effect */}
        <g filter="url(#enhancedGlow)">
          <Path
            d="M197.91 231.032L223.165 243.006L244.986 285.922L197.91 231.032Z"
            fill="url(#enhancedFill)"
            stroke="url(#animatedEdge)"
            strokeWidth={2}
          />
          <Path
            d="M196.853 229.424L246.063 179.975L223.253 241.941L196.853 229.424Z"
            fill="url(#enhancedFill)"
            stroke="url(#animatedEdge)"
            strokeWidth={2}
          />
          <Path
            d="M224.323 243.077L297.36 238.425L247.456 288.573L224.323 243.077Z"
            fill="url(#enhancedFill)"
            stroke="url(#animatedEdge)"
            strokeWidth={2}
          />
          <Path
            d="M224.267 242.079L247.498 178.972L297.614 237.407L224.267 242.079Z"
            fill="url(#enhancedFill)"
            stroke="url(#animatedEdge)"
            strokeWidth={2}
          />
        </g>

        {/* Main structure with noise and glitch */}
        <g filter="url(#enhancedNoise)">
          <g filter="url(#glitch)">
            <g filter="url(#edgeEffect)">
              {/* Main paths repeated for layered effect */}
              <Path
                d="M197.91 231.032L223.165 243.006L244.986 285.922L197.91 231.032Z"
                fill="url(#enhancedFill)"
                stroke="url(#animatedEdge)"
                strokeWidth={2}
              />
              <Path
                d="M196.853 229.424L246.063 179.975L223.253 241.941L196.853 229.424Z"
                fill="url(#enhancedFill)"
                stroke="url(#animatedEdge)"
                strokeWidth={2}
              />
              <Path
                d="M224.323 243.077L297.36 238.425L247.456 288.573L224.323 243.077Z"
                fill="url(#enhancedFill)"
                stroke="url(#animatedEdge)"
                strokeWidth={2}
              />
              <Path
                d="M224.267 242.079L247.498 178.972L297.614 237.407L224.267 242.079Z"
                fill="url(#enhancedFill)"
                stroke="url(#animatedEdge)"
                strokeWidth={2}
              />
            </g>
          </g>
        </g>

        {/* Enhanced connecting lines */}
        <g opacity="0.8" filter="url(#edgeEffect)">
          <Path
            d="M247 158.5V78"
            stroke="url(#animatedEdge)"
            strokeWidth={1.5}
            strokeDasharray="8 12"
          />
          <Path
            d="M247 309V389.5"
            stroke="url(#animatedEdge)"
            strokeWidth={1.5}
            strokeDasharray="8 12"
          />
          <Path
            d="M176.5 230H96"
            stroke="url(#animatedEdge)"
            strokeWidth={1.5}
            strokeDasharray="8 12"
          />
          <Path
            d="M319 238H399.5"
            stroke="url(#animatedEdge)"
            strokeWidth={1.5}
            strokeDasharray="8 12"
          />
        </g>
      </Svg>
    </Animated.View>
  );
};

export default OctahedronSvg;
